const darkTheme = {
  palette: {
    mode: 'dark',
    primary: {
      main: '#eb7134',
    },
  },
};
// https://www.color-hex.com/color-palette/1022622
const lightTheme = {
  palette: {
    type: 'light',
    primary: {
      main: '#42394b',
      contrastText: '#fff',
    },
    secondary: {
      main: '#faf4ec',
      contrastText: '#31293b',
    },
    tertiary: {
      main: '#fbe49b',
      contrastText: '#fff',
    },
  },
  typography: {
    h2: {
      fontSize: 35,
    },
    h6: {
      fontSize: 16,
      fontWeight: 600,

    },
  },
  button: {
    width: 64,
    height: 64,
    padding: 0,
  },
};

export {lightTheme};
export {darkTheme};
